import React, { useContext, useState, useEffect } from "react";
import { useNavigation } from "@react-navigation/native";
import { BackgroundLinear } from "./gradient";

import {
  Container,  
  TitleComponet,  
  ButtonComponet,
} from "./styles";

const Home = () => {
  const navigation = useNavigation();

  return (
    <BackgroundLinear>
      <Container>
        <TitleComponet>Home</TitleComponet>
      
          <ButtonComponet  onPress={() => navigation.navigate("Login")}>
          <TitleComponet>Voltar</TitleComponet>
          </ButtonComponet>
     
      </Container>
    </BackgroundLinear>
  );
};

export default Home;
